      data: [12, 19, 3, 5, 2],
      backgroundColor: [
        '#FF6384',
        '#36A2EB',
        '#FFCE56',
        '#4CAF50',
        '#E91E63'
      ],
      hoverBackgroundColor: [
        '#FF6384',
        '#36A2EB',
        '#FFCE56',
        '#4CAF50',
        '#E91E63'
      ],
    },
  ],
};

const options = {
  maintainAspectRatio: false,
  responsive: true,
  legend: {
    position: 'bottom',
  },
};

const DoughnutChart = () => (
  React.createElement('div', null,
    React.createElement('h2', null, 'Doughnut Chart Example'),
    React.createElement(Doughnut, { data: data, options: options })
  )
);

module.exports = DoughnutChart;
